    render() {
        
        const { historyarray } = this.props;
        console.log(historyarray);
        return(
            <div className="pa4">
                <div className="overflow-auto">
                    <table className="f5 w-100 mw8 center" cellspacing="0">
                        <thead className='w-50 center1'>
                            <tr className='flex flex-auto'>
                                <th className="w-25 fw6 bb b--black-20 pb3 pr3 ">Location</th>
                                <th className="w-25 fw6 bb b--black-20 pb3 pr3 ">In/Out</th>
                                <th className="w-25 fw6 bb b--black-20 pb3 pr3 ">Date</th>
                                <th className="w-25 fw6 bb b--black-20  pb3 pr3 ">Time</th>
                            </tr>
                        </thead>
                        <tbody className="lh-copy center1 w-50">
                            {historyarray.map(function(data, i){
                                return(
                                    <tr className='flex flex-auto' >
                                        <td key={i} className="w-25 pv3 pr3 bb b--black-20">{data.location}</td>
                                        <td key={i} className="w-25 pv3 pr3 bb b--black-20">{data.inout}</td>
                                        <td key={i} className="w-25 pv3 pr3 bb b--black-20">{data.date}</td>
                                        <td key={i} className="w-25 pv3 pr3 bb b--black-20">{data.time}</td>
                                    </tr>
                                )
                            })}  
                        </tbody>
                    </table>
                </div>
            </div>
        )
    }
}


export default History;
